// Libs
import React, { Component } from 'react'

class NotFound extends Component {
    render() {
        return (
            <div>
                <div className="nes-container is-dark" style={{
                    marginTop: '30px',
                    marginBottom: '30px',
                    marginLeft: '70px',
                    marginRight: '70px'
                }}>
                    <h1>Page NotFound</h1>
                </div>
            </div>
        )
    }
}

export default NotFound
